import ContactUs from "./pages/contact-us/contact-us.component";
import AboutPage from "./pages/about-page/about-page.component";

import 'bootstrap/dist/css/bootstrap.min.css';
import './App.scss';

const App = () => {
  return (
    <>
      <Navbar/>
      <Homepage/>
      {/* <ContactUs/> */}
      {/* <AboutPage/> */}
      <Footer/>
    </>
  );
}

export default App;
